import React from 'react';
import Form from './form.jpg'; // Adjust path if necessary

function FormPage() {
  return (
    <div>
      <h1>Student Admission Form</h1>
      <img src={Form} alt="Student Admission Form" style={{ width: '60', height: 'auto' }} />
    </div>
  );
}

export default FormPage;
